namespace C_Ijun
{
    internal class Program
    {
        static void Main(string[] args)
        {
            int countMultipleNums = 0;
            int startRangeGenerateNum = 1;
            int endRangeGenerateNum = 28;
            int startOfRange = 100;
            int endOfRange = 999;
            int generateNum = new Random().Next(startRangeGenerateNum, endRangeGenerateNum);

            Console.WriteLine($"Кратные числа\nСгенерированное число - {generateNum}.");

            for (int i = generateNum; i <= endOfRange; i += generateNum)
            {
                if (i >= startOfRange)
                {
                    countMultipleNums += 1;
                    Console.WriteLine($"{i} кратно {generateNum}");
                }
            }

            Console.Write($"Количество кратных чисел - {countMultipleNums}.");
            Console.ReadLine();
        }
    }
}

#include <iostream>

using namespace std;

void Print(int* arr, int size) {
	for (int i = 0; i < size; i++) {
		cout << arr[i] << " ";
	}
	cout << endl;
}

void Fill(int* arr, int size) {
	for (int i = 0; i < size; i++) {
		arr[i] = rand() % 10;
	}
}

bool IsSimple(int number) {
	for (int i = 2; i < number; i++) {
		if (number % i == 0) {
			return false;
		}
	}
	return true;
}

int main() {
	// удаление из массива все простые числа
	srand(time(NULL));
	setlocale(LC_ALL, "ru");

	int size;
	cout << "Введите размер массива: ";
	cin >> size;

	int* arr = new int[size];

	Fill(arr, size);
	Print(arr, size);

	int count = 0;
	for (int i = 0; i < size; i++) {
		if (!IsSimple(arr[i])) {
			count++;
		}
	}

	int* result = new int[count];

	count = 0;
	for (int i = 0; i < size; i++) {
		if (!IsSimple(arr[i])) {
			result[count] = arr[i];
			count++;
		}
	}

	delete[] arr;
	arr = result;
	size = count;

	Print(arr, size);

	delete[] result;
}

ostream& operator<<(ostream& os, const BusesForStopResponse& r) {
